import './home.css';
import * as AiIcons from 'react-icons/ai';

const Home = () => {
    return (
        <>
          <div className='title col-md-6'>
          </div>

          <div className='title col-md-6'>
            <p>Hello, my name is Charlie, I am a front-end developer from the UK. I program in JavaScript as well as working with many front-end technologies. I specialise in building component-based interfaces with ReactJS.</p>
            <a className='btn btn-outline-success'>view my work<AiIcons.AiFillHome width='300px'/></a>
           </div> 
        </>
    )
}

export default Home
